import React from "react";
import { DropdownButton, Dropdown } from "react-bootstrap";
import DropdownItem from "react-bootstrap/esm/DropdownItem";

export default function LeftNav(props) {


  return (
    <div className="leftNav">
      <DropdownButton id="dropdown-item-button">
        <div className="dropdownMenu">
          <Dropdown.Item as="button" onClick={() => props.eventShow(true)}>
            All Events
          </Dropdown.Item>
          <Dropdown.Item as="button">Your Events</Dropdown.Item>
          <Dropdown.Item as="button">Friend's List</Dropdown.Item>
          <Dropdown.Divider />
          <Dropdown.Item>
            {friendArray.map((id) => (
              <div key={id._id}>
                <p>Description: {id.title}</p>
                <Button onClick={() => detailPanTo(id)}>Details</Button>
                <Dropdown.Divider />
              </div>
            ))}
          </Dropdown.Item>
        </div>
      </DropdownButton>
    </div>
  );
}
